using System;
using Fegora.Servicios.Model;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace Fegora.Servicios.Tests
{
    [TestClass]
    public class LoteTests
    {
        private Api fegora;

        [TestInitialize]
        public void ConfiguracionTests()
        {
            // si no usas el constructor con valores, son tomados de tu archivo de configuracion
            //fegora = new Api();

            // si desea puede incluir los valores en el constructor
            var clientId = "";
            var clientSecret = "";
            var userName = "";
            var password = "";
            fegora = new Api(clientId, clientSecret, userName, password);
        }

        [TestMethod]
        public void CrearLote()
        {
            // construir el DTE
            var lote = new Lote();
            lote.IdCuenta = "43430775";
            lote.Archivo = "";
            
            // ejecutar la creacion
            var resp = fegora.Lotes.Crear(lote);

            // tests
            if (resp.TieneError)
            {
                ImprimirError(resp.Error);
            }          
            
            Assert.IsFalse(resp.TieneError);
            Assert.IsNotNull(resp.Contenido);
            Assert.IsNotNull(resp.Contenido.Id);

            // mostrar valores relevantes de impresion
            ImprimirInformacionRelevanteDocumento(resp.Contenido);            
        }

        [TestMethod]
        public void ObtenerLote()
        {
            // construir el DTE
            var lote = new Lote();
            lote.IdCuenta = "43430775";
            lote.Archivo = "";

            // ejecutar la creacion
            var resp = fegora.Lotes.Crear(lote);

            // tests
            if (resp.TieneError)
            {
                ImprimirError(resp.Error);
            }

            Assert.IsFalse(resp.TieneError);
            Assert.IsNotNull(resp.Contenido);
            Assert.IsNotNull(resp.Contenido.Id);

            var resp2 = fegora.Lotes.Obtener(resp.Contenido.Id);
            
            // tests
            if (resp2.TieneError)
            {
                ImprimirError(resp2.Error);
            }

            Assert.IsFalse(resp2.TieneError);
            Assert.IsNotNull(resp2.Contenido);
            Assert.IsNotNull(resp2.Contenido.Id);            

            // mostrar valores relevantes de impresion
            ImprimirInformacionRelevanteDocumento(resp2.Contenido);
        }

        [TestMethod]
        public void ActualizarParcialLote()
        {
            // construir el DTE
            var lote = new Lote();
            lote.IdCuenta = "43430775";
            lote.Archivo = "";

            // ejecutar la creacion
            var resp = fegora.Lotes.Crear(lote);

            // tests
            if (resp.TieneError)
            {
                ImprimirError(resp.Error);
            }

            Assert.IsFalse(resp.TieneError);
            Assert.IsNotNull(resp.Contenido);
            Assert.IsNotNull(resp.Contenido.Id);

            // actualizar
            var loteAACtualizar = new Lote();
            loteAACtualizar.Id = resp.Contenido.Id;
            loteAACtualizar.CantidadOperacionesPendientesEjecucion = 0;
            loteAACtualizar.CantidadOperacionesEjecutadas = resp.Contenido.CantidadOperaciones;
            loteAACtualizar.Estado = "procesado";

            var resp2 = fegora.Lotes.ActualizarParcial(loteAACtualizar);

            if (resp2.TieneError)
            {
                ImprimirError(resp2.Error);
            }

            Assert.IsFalse(resp2.TieneError);
            Assert.IsNotNull(resp2.Contenido);
            Assert.IsNotNull(resp2.Contenido.Id);
            Assert.AreEqual(0, resp2.Contenido.CantidadOperacionesPendientesEjecucion);
            Assert.AreEqual(loteAACtualizar.CantidadOperacionesEjecutadas, resp2.Contenido.CantidadOperacionesEjecutadas);

            // mostrar valores relevantes de impresion
            ImprimirInformacionRelevanteDocumento(resp2.Contenido);
        }

        private void ImprimirInformacionRelevanteDocumento(Lote lote)
        {
            Console.WriteLine("Lote creado");
            Console.WriteLine("------------------");
            Console.WriteLine("ID: {0}", lote.Id);
            Console.WriteLine("Estado: {0}", lote.Estado);
            Console.WriteLine("Cantidad Operaciones: {0}", lote.CantidadOperaciones);            
        }

        private void ImprimirError(Error error)
        {
            Console.WriteLine("ERROR!");
            Console.WriteLine("-----------------");
            Console.WriteLine("Codigo: {0}", error.Codigo);
            Console.WriteLine("Mensaje: {0}", error.Mensaje);                        
        }


    }
}
